import React from "react";

function DeleteQuizPopup() {
  return (
    <div
      style={{
        paddingBottom: "5vh",
        width: "57vw",
        marginTop: "30vh",
        marginLeft: "3vw",
        backgroundColor: "white",
        borderRadius: "10px",
     
            position: "fixed",
            top: 0,
            left: 0,
           
            height: "100vh",
            backgroundColor: "rgba(255, 255, 255, 0.8)", // Semi-transparent white
            backdropFilter: "blur(5px)", // Add the blur effect
            zIndex: 1000, // Adjust the z-index to make sure it's on top
          
      }}
    >
      <p
        style={{
          fontSize: "2.5em",
          fontWeight: "600",
          color: "#474444",
          textAlign: "center",
          paddingTop: "2vh",
        }}
      >
        <p>Are you confirm you</p>
        <p> want to delete ?</p>
      </p>

      <div
        style={{
          display: "flex",
          marginLeft: "6vw",
          marginTop: "8vh",
          gap: "5vw",
          marginRight: "3vw",
        }}
      >
        <button
          style={{
            height: "6vh",
            width: "20vw",
            borderRadius: "10px",
            color: "#FFFFFF",
            fontSize: "1.2em",
            backgroundColor: "#FF4B4B",
            border: "none",
          }}
        >
          Confirm Delete
        </button>
        <button
          style={{
            height: "6vh",
            width: "20vw",
            borderRadius: "10px",
            color: "#474444",
            fontSize: "1.2em",
            backgroundColor:"white",
            boxShadow: "0px 0px 15px 0px #00000040",
            border:"none"
          }}
        >
          Cancel
        </button>
      </div>
    </div>
  );
}

export default DeleteQuizPopup;
